import React, { useEffect } from 'react';
import 'admin-lte/dist/js/adminlte.min.js';

const Home = () => {
  useEffect(() => {
    // Inicializar componentes de AdminLTE si es necesario
    window.AdminLTE = window.AdminLTE || {};
    window.AdminLTE.Layout = window.AdminLTE.Layout || {};
    window.AdminLTE.Layout.init();
  }, []);

  return (
    <div className="wrapper">
      {/* Aqu√≠ va tu contenido del dashboard usando clases de AdminLTE */}
    </div>
  );
};

export default Home;
